import { Data } from "./Data"
import React from 'react';
import { Subgrid, SuperSubgrid } from "./Counteranimation.element";
function Component(props) {
    Data=props;
    return (
        <>
        <Subgrid>
            <SuperSubgrid>
                <div>{Data}</div>
                <div></div>
                <div></div>
            </SuperSubgrid>
        </Subgrid>

     </>
    )
}

export default Component
